あしぽかサプリ【ぽかりん】
<BR><BR>
＜栄養機能食品（マグネシウム）＞
<BR>
マグネシウムは、骨や歯の形成に必要な栄養素です。マグネシウムは、多くの体内酵素の正常な働きとエネルギー産生を助けるとともに、血液循環を保つのに必要な栄養素です。
<BR><BR>
１日２粒　６０粒入り　約１ヶ月分<BR>
朝2粒飲むだけ。<BR>
身体の芯からぽかぽかサポート。<BR>
<BR>
とにかく足が冷たい、足が冷えて眠れない。脚の冷たさで通勤が億劫。そんなあなたのための、足冷え専用サプリです。<BR><BR>
冷え取り靴下や湯たんぽもいいけど、これからは内側からぽかぽかする時代。冷えとり靴下との組み合わせもOK.W(ダブル)スチームジンジャーは温め成分“しょうがの6倍”。カプサイシン配合で発汗ダイエット効果も期待できます。女性に嬉しい“葉酸”配合。頭痛やけだるさで辛い朝をスッキリ健康に。末端冷え性でお悩みの方にもオススメです。
<BR>
<BR>
名称：マグネシウム含有食品<BR>
原材料名：デキストリン、生姜末、唐辛子、V.E含有植物油、還元麦芽糖水飴、黒胡椒抽出物、ヒハツエキス/酸化Mg、糖転移ヘスペリジン、V.C、セルロース、香料、ピロリン酸鉄、V.B6、パントテン酸Ca、V.B1、V.B2、ナイアシン、微粒酸化ケイ素、ステアリン酸Ca、加工でデンプン、葉酸、V.B12、シュラック<BR>
内容量：320mg　60粒入(30日分)
<br><br>
広告文責：株式会社ドットジャパン<br>
電話：03:6914:5420<br>
発売元：オルト株式会社<br>
製造：日本製<br>
商品区分：栄養機能食品
