女性用　うぶ毛専用カミソリ。うぶ毛を処理することで、化粧のりが良くなる。顔が明るくなる等の効果が期待できます。しかし、カミソリを使うと肌を痛める。処理するのが面倒等の悩みを持つ方も居ます。それらを解消するうぶ毛専用のカミソリ。Ｔ型タイプカミソリ。<br><br>化粧品(\)男性化粧品(メンズコスメ)(\)男性化粧品(メンズコスメ) シェービング <br>bi-hada(ビハダ) T型 2本入<br>フェイス用カミソリです。うぶ毛そり用のカミソリです。<br> 使用方法：1.乳液やクリームをつけると、カミソリのすべりがよくなり、肌への負担が減ります。2.毛の流れに沿ってやさしく剃ります。3.カミソリを持っていないほうの手で、肌を押さえるとスムーズに剃れます。4.ボディのうぶ毛も、力を入れすぎず、毛の流れに沿ってやさしく剃ります。 <br>ご注意：●刃物ですので、取り扱いや保管には十分ご注意ください。<br>●うぶ毛そり用カミソリです。その目的以外に使用しないでください。<br>●お肌に合わない時は、ご使用を中止してください。<br>●刃先を拭かないでください。肌を痛めるおそれがあります。<br>●そる部分に乳液やクリーム、またはよく泡立てた石けんなどをつけて使用してください。カミソリを持つ手がすべらないように注意してください。<br>●使用後はよくすすぎ、水気をきってから、キャップをして乾燥した所に保管してください。<br>●70度以上の熱湯に入れないでください。変形することがあります。<br>●未使用のカミソリは乾燥した所に保管してください。湿度の高い場所では、スムーザーが溶け出す場合があります。スムーザーは溶けて色が変わります。品質に変化はありません。<br>●お子様の手の届かない所に保管してください。 品質表示●刃部・ステンレス刃物鋼/長さ31mm・チタニコーティング刃先処理フィルムガード：特殊樹脂フィルム・スムーザー：水溶性樹脂●ホルダー・PP：耐熱温度70度キャップ：PP●長さ：116mm●重さ：10.2g <br>原産国：中国<br><br> お問い合わせ先：貝印カミソリ株式会社 お客様相談室：03-3862-6410受付時間：9：00-12：00(土、日、祝日を除く)  <br>販売_製造元： 貝印<br>ブランド：bi-hada(ビハダ)<br>JAN：4901331015823<br>CS：200<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
